import './input.css';

function Input(props) {
  return (
    <div className="input">
        <label className="input__label" for="input">{props.label}</label>
        <div className={`input__input_group ${props.cname}`}>
          <span className="input_group__icon-left">
          <svg viewBox="0 0 16 16" fill="none" stroke="#8055FF" xmlns="http://www.w3.org/2000/svg">
                            <path d="M10.0355 10.0355C11.9882 8.08291 11.9882 4.91709 10.0355 2.96447C8.08291 1.01184 4.91709 1.01184 2.96447 2.96447C1.01184 4.91709 1.01184 8.08291 2.96447 10.0355C4.91709 11.9882 8.08291 11.9882 10.0355 10.0355ZM10.0355 10.0355L14 14M14 14L14.5 13.5L11.5 10.5M14 14L13.5 14.5L10.5 11.5" fill="none"/>
                        </svg>
          </span>
          <input type="text" className="input_group__text" placeholder={props.placeholder} value={props.value}/>
          <span className="input_group__icon-right">
            <svg viewBox="0 0 16 16" fill="none" stroke={props.rstroke} xmlns="http://www.w3.org/2000/svg">
              <path d={props.rpath} fill="none" />
            </svg>
          </span>
        </div>
    </div>
  );
}

export default Input;
